import React from 'react';
import './styles.css'
function Header() {
  return (
    <header className=" h-[100vh] flex items-center flex-col p-[150px] pt-[50px]  ">
      <div
        className="home-hero99"
        style={{
          backgroundImage: `url(${process.env.PUBLIC_URL}/../../../assets/fundo.webp)`,
          backgroundRepeat: 'no-repeat',
          backgroundSize: 'cover',
        }}
      >
        <div className="home-container4">
          <div className="home-left2">
            <div>
              <img
                src={`${process.env.PUBLIC_URL}/../../../assets/fabricando.PNG`}
                alt="pastedImage"
                className="fad"
              />
            </div>
            <div>
              <img
                src={`${process.env.PUBLIC_URL}/../../../assets/digital.PNG`}
                alt="pastedImage"
                className="fad2"
              />
            </div>
          </div>
          <div className="home-image-container2">
            <img
              alt="pastedImage"
              src={`${process.env.PUBLIC_URL}/../../../assets/logoHeader.avif`}
              className="home-cards-image2"
            />
          </div>
        </div>
      </div>
    </header>
  );
}

export default Header;
